def setUnion(a, b):
    result = set()
    for element in a:
        result.add(element)
    for element in b:
        if(element not in a):
            result.add(element)
    return result


def setIntersection(a, b):
    result = set()
    for element in b:
        if(element in a) :
            result.add(element)
    return result


def setDifference(a, b):
    result = set()
    for element in a:
        if(element not in b) :
            result.add(element)
    return result

